import React from 'react';
import '../styles/Home.css';
import OurYachts from './OurYachts';

const Home = () => {
    return (
        <div className="home">
            <div className="home-hero">
                <div className="hero-content">
                    <h1>Welcome to Dharma Yacht Rental</h1>
                    <p>Experience luxury like never before</p>
                    <button className="btn">Book Now</button>
                </div>
            </div>
            <section className="yacht-section">
                <OurYachts />
            </section>
        </div>
    );
};

export default Home;
